import React from 'react';
import '../styles/navbar.css';

function NavBar() {
    return (
        <div className="nv-container">
            <div className="left">
                LOGO
                <hr className='hr' />
            </div>
            <div className="right">
                <div className="option">00H Home
                    <hr hidden /> </div>
                <div className="option">00H Home  <hr hidden={true} /> </div>
                <div className="option">00H Home  <hr hidden /> </div>
                <div className="option">00H Home <hr hidden />  </div>
            </div>
        </div>
    );
}

export default NavBar;
